import React from 'react';

const Product = () => {
  return (
    <div>
      <img src='./img/product_1.png' alt='Arroz Prato Fino' />
      <h1>Arroz Prato Fino</h1>
      <h2>Tradicional Tipo 1 500g</h2>
    </div>
  )
}

export default Product;
